eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   conceptos: () => (/* binding */ conceptos)\n/* harmony export */ });\nconst conceptos = [\n    {\n        id: 1,\n        tema: \"conceptos\",\n        titulo: \"Plusval\\xeda Municipal\",\n        contenido: \"Impuesto municipal sobre el incremento de valor de los terrenos urbanos.\",\n        detalles: `\n      <p><strong>Definición:</strong> Impuesto municipal que grava el incremento de valor que experimentan los terrenos urbanos y se pone de manifiesto como consecuencia de la transmisión de la propiedad o de la constitución o transmisión de derechos reales.</p>\n      \n      <p><strong>Características principales:</strong></p>\n      <ul>\n        <li>Es un <strong>impuesto directo</strong> y <strong>objetivo</strong></li>\n        <li>Grava la <strong>capacidad económica</strong> manifestada por el incremento de valor del terreno</li>\n        <li>Es de <strong>gestión municipal</strong></li>\n        <li>Se devenga en el momento de la transmisión</li>\n      </ul>\n\n      <p><strong>Hecho imponible:</strong> El incremento de valor de los terrenos de naturaleza urbana que se ponga de manifiesto en:</p>\n      <ul>\n        <li>Transmisiones de la propiedad</li>\n        <li>Constitución o transmisión de derechos reales de goce o garantía</li>\n        <li>Aportaciones de bienes a sociedades</li>\n      </ul>\n\n      <p><strong>Base imponible:</strong> Incremento de valor experimentado por el terreno durante el tiempo de posesión.</p>\n    `,\n        estudiado: false\n    },\n    {\n        id: 2,\n        tema: \"conceptos\",\n        titulo: \"Sistema Presidencialista\",\n        contenido: \"Sistema de gobierno donde el presidente es a la vez jefe de Estado y jefe de Gobierno.\",\n        detalles: `\n      <p><strong>Definición:</strong> Sistema político en el que el poder ejecutivo recae en un presidente que es elegido de forma independiente del poder legislativo y que ejerce simultáneamente las funciones de jefe de Estado y jefe de Gobierno.</p>\n\n      <p><strong>Características principales:</strong></p>\n      <ul>\n        <li><strong>Separación rígida de poderes</strong> entre ejecutivo y legislativo</li>\n        <li>El presidente es <strong>elegido directamente</strong> por el pueblo</li>\n        <li>El presidente <strong>no puede disolver</strong> el parlamento</li>\n        <li>El parlamento <strong>no puede destituir</strong> al presidente fácilmente</li>\n        <li>Doble legitimidad democrática (presidente y parlamento)</li>\n      </ul>\n\n      <p><strong>Ejemplos:</strong> Estados Unidos, México, Brasil, Argentina</p>\n\n      <p><strong>Diferencias con el sistema parlamentario:</strong></p>\n      <table>\n        <tr><th>Sistema Presidencialista</th><th>Sistema Parlamentario</th></tr>\n        <tr><td>Separación rígida de poderes</td><td>Colaboración de poderes</td></tr>\n        <tr><td>Presidente elegido directamente</td><td>Gobierno surge del parlamento</td></tr>\n        <tr><td>No hay moción de censura</td><td>Posible moción de censura</td></tr>\n        <tr><td>Doble legitimidad</td><td>Legitimidad única del parlamento</td></tr>\n      </table>\n    `,\n        estudiado: false\n    },\n    {\n        id: 3,\n        tema: \"conceptos\",\n        titulo: \"Concejo Abierto\",\n        contenido: \"Sistema de gobierno municipal para peque\\xf1os municipios basado en la asamblea vecinal.\",\n        detalles: `\n      <p><strong>Definición:</strong> Régimen especial de organización municipal aplicable a municipios con pequeña población, en el que el gobierno y administración corresponden a un Alcalde y una Asamblea Vecinal de la que forman parte todos los electores.</p>\n\n      <p><strong>Características:</strong></p>\n      <ul>\n        <li>Aplicable a municipios con <strong>menos de 100 habitantes</strong> y que no superen los 100 por tradición</li>\n        <li>Órganos de gobierno:\n          <ul>\n            <li><strong>Alcalde</strong>: Elegido por los vecinos</li>\n            <li><strong>Asamblea Vecinal</strong>: Formada por todos los electores del municipio</li>\n          </ul>\n        </li>\n        <li>Funcionamiento más <strong>directo y participativo</strong></li>\n        <li>Mayor <strong>transparencia</strong> en la gestión</li>\n      </ul>\n\n      <p><strong>Competencias de la Asamblea Vecinal:</strong></p>\n      <ul>\n        <li>Aprobación de ordenanzas</li>\n        <li>Aprobación de presupuestos</li>\n        <li>Control de la gestión del Alcalde</li>\n        <li>Decisión sobre asuntos de especial importancia</li>\n      </ul>\n\n      <p><strong>Base legal:</strong> Ley 7/1985, de 2 de abril, Reguladora de las Bases del Régimen Local (Art. 29)</p>\n    `,\n        estudiado: false\n    },\n    {\n        id: 4,\n        tema: \"conceptos\",\n        titulo: \"Ley de Grandes Ciudades\",\n        contenido: \"Ley que regula el r\\xe9gimen especial de los municipios de gran poblaci\\xf3n.\",\n        detalles: `\n      <p><strong>Definición:</strong> Ley 57/2003, de 16 de diciembre, de medidas para la modernización del gobierno local, que establece un régimen especial de organización para los municipios de gran población.</p>\n\n      <p><strong>Municipios afectados:</strong></p>\n      <ul>\n        <li>Municipios con <strong>más de 250,000 habitantes</strong></li>\n        <li>Capitales de provincia con <strong>más de 175,000 habitantes</strong></li>\n        <li>Capitales de provincia que sean sede de las instituciones autonómicas</li>\n        <li>Municipios de más de 75,000 habitantes con circunstancias especiales</li>\n      </ul>\n\n      <p><strong>Principales características:</strong></p>\n      <ul>\n        <li><strong>Mayor descentralización</strong> mediante distritos</li>\n        <li>Creación de <strong>Juntas Municipales de Distrito</strong></li>\n        <li>Órganos de <strong>participación ciudadana</strong></li>\n        <li>Régimen especial de <strong>organización y competencias</strong></li>\n        <li>Mayores <strong>recursos y capacidades</strong></li>\n      </ul>\n\n      <p><strong>Estructura organizativa adicional:</strong></p>\n      <ul>\n        <li>Consejo Social de la Ciudad</li>\n        <li>Consejos de Distrito</li>\n        <li>Juntas Municipales de Distrito</li>\n        <li>Órganos desconcentrados</li>\n      </ul>\n    `,\n        estudiado: false\n    },\n    {\n        id: 5,\n        tema: \"conceptos\",\n        titulo: \"Devengo\",\n        contenido: \"Momento en el que se entiende realizado el hecho imponible de un tributo.\",\n        detalles: `\n      <p><strong>Definición:</strong> Momento temporal en el que se entiende realizado el hecho imponible y, por tanto, nacida la obligación tributaria principal.</p>\n\n      <p><strong>Importancia:</strong></p>\n      <ul>\n        <li>Determina el <strong>periodo impositivo</strong></li>\n        <li>Fija las <strong>normas aplicables</strong></li>\n        <li>Establece el <strong>momento del pago</strong></li>\n        <li>Define la <strong>obligación de declarar</strong></li>\n      </ul>\n\n      <p><strong>Ejemplos por tributos:</strong></p>\n      <table>\n        <tr><th>Tributo</th><th>Momento de Devengo</th></tr>\n        <tr><td>IRPF</td><td>31 de diciembre del ejercicio</td></tr>\n        <tr><td>IVA</td><td>Momento de la entrega de bienes o prestación de servicios</td></tr>\n        <tr><td>Impuesto de Sociedades</td><td>Último día del periodo impositivo</td></tr>\n        <tr><td>IBI</td><td>1 de enero de cada año</td></tr>\n      </table>\n\n      <p><strong>Diferencias con otros conceptos:</strong></p>\n      <ul>\n        <li><strong>Devengo vs. Exigibilidad:</strong> El devengo es el nacimiento de la obligación, la exigibilidad es cuando se puede reclamar el pago</li>\n        <li><strong>Devengo vs. Pago:</strong> El devengo es el momento del hecho imponible, el pago es cuando se satisface la deuda</li>\n      </ul>\n\n      <p><strong>Base legal:</strong> Ley 58/2003, de 17 de diciembre, General Tributaria (Art. 21)</p>\n    `,\n        estudiado: false\n    },\n    {\n        id: 6,\n        tema: \"conceptos\",\n        titulo: \"Sufragio Activo\",\n        contenido: \"Derecho a votar en elecciones y refer\\xe9ndums.\",\n        detalles: `\n      <p><strong>Definición:</strong> Derecho de los ciudadanos a elegir a sus representantes políticos mediante el voto en procesos electorales.</p>\n\n      <p><strong>Características en España:</strong></p>\n      <ul>\n        <li><strong>Universal:</strong> Para todos los ciudadanos mayores de edad</li>\n        <li><strong>Libre:</strong> Sin coacciones</li>\n        <li><strong>Igual:</strong> Un ciudadano, un voto</li>\n        <li><strong>Directo:</strong> Sin intermediarios</li>\n        <li><strong>Secreto:</strong> Garantía de privacidad</li>\n      </ul>\n\n      <p><strong>Requisitos generales:</strong></p>\n      <ul>\n        <li>Tener <strong>18 años</strong> cumplidos</li>\n        <li>Estar <strong>inscrito en el censo electoral</strong></li>\n        <li>No estar incurso en causas de incapacidad o incompatibilidad</li>\n      </ul>\n\n      <p><strong>Derechos por tipo de elección:</strong></p>\n      <table>\n        <tr><th>Tipo de Elección</th><th>Ciudadanos Españoles</th><th>Ciudadanos de la UE</th></tr>\n        <tr><td><strong>Elecciones Municipales</strong></td><td>✅ SÍ</td><td>✅ SÍ (con residencia)</td></tr>\n        <tr><td><strong>Elecciones Autonómicas</strong></td><td>✅ SÍ</td><td>❌ NO*</td></tr>\n        <tr><td><strong>Elecciones Generales</strong></td><td>✅ SÍ</td><td>❌ NO</td></tr>\n        <tr><td><strong>Elecciones Europeas</strong></td><td>✅ SÍ</td><td>✅ SÍ (en España o país origen)</td></tr>\n        <tr><td><strong>Referéndums Nacionales</strong></td><td>✅ SÍ</td><td>❌ NO</td></tr>\n        <tr><td><strong>Referéndums Municipales</strong></td><td>✅ SÍ</td><td>✅ SÍ (con residencia)</td></tr>\n      </table>\n\n      <p><strong>Requisitos específicos para ciudadanos de la UE:</strong></p>\n      <ul>\n        <li><strong>Nacionalidad:</strong> Ser ciudadano de un país miembro de la UE</li>\n        <li><strong>Residencia:</strong> Residir legalmente en España</li>\n        <li><strong>Inscripción:</strong> Estar inscrito en el Censo de Extranjeros Residentes (CERE)</li>\n        <li><strong>Declaración:</strong> No estar privado del derecho en su país de origen</li>\n      </ul>\n\n      <p><strong>Excepciones y casos especiales:</strong></p>\n      <ul>\n        <li><strong>*Elecciones autonómicas:</strong> Algunos estatutos permiten el voto con reciprocidad</li>\n        <li><strong>Elecciones europeas:</strong> Deben elegir votar en España o en su país de origen</li>\n        <li><strong>Brexit:</strong> Ciudadanos británicos perdieron estos derechos tras el Brexit</li>\n      </ul>\n\n      <p><strong>Base constitucional:</strong> Artículo 23.1 de la Constitución Española y Artículo 13.2 para ciudadanos de la UE</p>\n\n      <p><strong>Normativa aplicable:</strong></p>\n      <ul>\n        <li>Ley Orgánica 5/1985, de 19 de junio, del Régimen Electoral General</li>\n        <li>Real Decreto 207/1996 sobre derechos de participación de ciudadanos de la UE</li>\n        <li>Tratado de Funcionamiento de la Unión Europea (Art. 22)</li>\n      </ul>\n    `,\n        estudiado: false\n    },\n    {\n        id: 7,\n        tema: \"conceptos\",\n        titulo: \"Sufragio Pasivo\",\n        contenido: \"Derecho a ser elegido como representante en elecciones.\",\n        detalles: `\n      <p><strong>Definición:</strong> Derecho de los ciudadanos a presentarse como candidatos y ser elegidos para cargos públicos en procesos electorales.</p>\n\n      <p><strong>Características:</strong></p>\n      <ul>\n        <li>Complementario al sufragio activo</li>\n        <li>Base de la <strong>representación política</strong></li>\n        <li>Sujeto a <strong>requisitos específicos</strong> según el cargo</li>\n        <li>Puede tener <strong>limitaciones por incompatibilidades</strong></li>\n      </ul>\n\n      <p><strong>Derechos por tipo de cargo:</strong></p>\n      <table>\n        <tr><th>Cargo Público</th><th>Ciudadanos Españoles</th><th>Ciudadanos de la UE</th></tr>\n        <tr><td><strong>Concejal</strong></td><td>✅ SÍ</td><td>✅ SÍ (con residencia)</td></tr>\n        <tr><td><strong>Alcalde</strong></td><td>✅ SÍ</td><td>✅ SÍ (si es elegido concejal)</td></tr>\n        <tr><td><strong>Diputado Autonómico</strong></td><td>✅ SÍ</td><td>❌ NO*</td></tr>\n        <tr><td><strong>Diputado/Senador</strong></td><td>✅ SÍ</td><td>❌ NO</td></tr>\n        <tr><td><strong>Presidente Gobierno</strong></td><td>✅ SÍ</td><td>❌ NO</td></tr>\n        <tr><td><strong>Eurodiputado</strong></td><td>✅ SÍ</td><td>✅ SÍ (en cualquier país UE)</td></tr>\n      </table>\n\n      <p><strong>Requisitos generales:</strong></p>\n      <ul>\n        <li>Estar en <strong>pleno uso de derechos políticos</strong></li>\n        <li>No estar incurso en <strong>causas de inelegibilidad</strong></li>\n        <li>No tener <strong>condenas que afecten</strong> a este derecho</li>\n      </ul>\n\n      <p><strong>Requisitos específicos para ciudadanos de la UE:</strong></p>\n      <ul>\n        <li><strong>Para cargos municipales:</strong>\n          <ul>\n            <li>Nacionalidad de país miembro de la UE</li>\n            <li>Residencia legal en España</li>\n            <li>Inscripción en el censo electoral municipal</li>\n            <li>No estar privado del derecho en país de origen</li>\n          </ul>\n        </li>\n      </ul>\n\n      <p><strong>Edades mínimas por cargo:</strong></p>\n      <table>\n        <tr><th>Cargo</th><th>Edad mínima</th><th>Notas</th></tr>\n        <tr><td>Concejal</td><td>18 años</td><td>Para españoles y ciudadanos UE</td></tr>\n        <tr><td>Alcalde</td><td>18 años</td><td>Debe ser concejal primero</td></tr>\n        <tr><td>Diputado Autonómico</td><td>18 años</td><td>Solo españoles</td></tr>\n        <tr><td>Diputado/Senador</td><td>18 años</td><td>Solo españoles</td></tr>\n        <tr><td>Presidente Gobierno</td><td>18 años</td><td>Solo españoles</td></tr>\n      </table>\n\n      <p><strong>Procedimiento para ciudadanos de la UE:</strong></p>\n      <ol>\n        <li><strong>Inscripción en el CERE</strong> (Censo de Extranjeros Residentes)</li>\n        <li><strong>Presentar candidatura</strong> mediante los partidos políticos</li>\n        <li><strong>Declarar</strong> no estar privado de derechos en país de origen</li>\n        <li><strong>Ser elegido concejal</strong> en elecciones municipales</li>\n        <li><strong>Para alcalde:</strong> Ser elegido por el Pleno municipal</li>\n      </ol>\n\n      <p><strong>Causas de inelegibilidad:</strong></p>\n      <ul>\n        <li>Miembros de la Familia Real</li>\n        <li>Altos cargos de la Administración en determinados territorios</li>\n        <li>Consejeros del Tribunal de Cuentas</li>\n        <li>Magistrados del Tribunal Constitucional</li>\n        <li>Defensor del Pueblo</li>\n        <li>Ciudadanos privados del derecho en su país de origen</li>\n      </ul>\n\n      <p><strong>Base constitucional:</strong> Artículo 23.2 de la Constitución Española y Artículo 13.2 para ciudadanos de la UE</p>\n\n      <p><strong>Limitaciones importantes:</strong></p>\n      <ul>\n        <li>Ciudadanos de la UE <strong>NO pueden</strong> acceder a cargos que ejerzan funciones de autoridad</li>\n        <li><strong>NO pueden</strong> ser tenientes de alcalde con delegaciones de autoridad</li>\n        <li><strong>NO pueden</strong> presidir mesas electorales</li>\n      </ul>\n    `,\n        estudiado: false\n    },\n    {\n        id: 8,\n        tema: \"conceptos\",\n        titulo: \"Cuota Tributaria\",\n        contenido: \"Cantidad a pagar como resultado de la liquidaci\\xf3n de un tributo.\",\n        detalles: `\n      <p><strong>Definición:</strong> Importe resultante de aplicar el tipo de gravamen a la base liquidable, una vez practicadas las deducciones y bonificaciones correspondientes.</p>\n\n      <p><strong>Componentes de la cuota:</strong></p>\n      <ul>\n        <li><strong>Cuota íntegra:</strong> Resultado de aplicar el tipo impositivo a la base liquidable</li>\n        <li><strong>Cuota líquida:</strong> Cuota íntegra menos deducciones</li>\n        <li><strong>Cuota diferencial:</strong> Cuota líquida menos pagos a cuenta y retenciones</li>\n      </ul>\n\n      <p><strong>Fórmula general:</strong></p>\n      <p><strong>Cuota Íntegra</strong> = Base Liquidable × Tipo Impositivo</p>\n      <p><strong>Cuota Líquida</strong> = Cuota Íntegra - Deducciones</p>\n      <p><strong>Cuota Diferencial</strong> = Cuota Líquida - (Pagos a cuenta + Retenciones)</p>\n\n      <p><strong>Ejemplo en IRPF:</strong></p>\n      <ul>\n        <li>Base liquidable: 30.000 €</li>\n        <li>Tipo impositivo: 20% = 6.000 € (cuota íntegra)</li>\n        <li>Deducciones: 1.000 €</li>\n        <li>Cuota líquida: 5.000 €</li>\n        <li>Retenciones: 4.000 €</li>\n        <li>Cuota diferencial: 1.000 € (a pagar)</li>\n      </ul>\n\n      <p><strong>Tipos de cuota:</strong></p>\n      <ul>\n        <li><strong>Cuota fija:</strong> Cantidad determinada (ej. tasas)</li>\n        <li><strong>Cuota variable:</strong> Depende de la base imponible</li>\n        <li><strong>Cuota mínima:</strong> Importe mínimo a pagar</li>\n      </ul>\n\n      <p><strong>Base legal:</strong> Ley 58/2003, de 17 de diciembre, General Tributaria</p>\n    `,\n        estudiado: false\n    },\n    {\n        id: 9,\n        tema: \"conceptos\",\n        titulo: \"Hecho Imponible\",\n        contenido: \"Presupuesto de hecho que origina el nacimiento de la obligaci\\xf3n tributaria.\",\n        detalles: `\n      <p><strong>Definición:</strong> Presupuesto establecido por la ley para configurar cada tributo y cuya realización origina el nacimiento de la obligación tributaria principal.</p>\n\n      <p><strong>Características:</strong></p>\n      <ul>\n        <li>Debe estar <strong>expresamente definido</strong> en la ley</li>\n        <li>Es <strong>específico para cada tributo</strong></li>\n        <li>Su realización <strong>origina la obligación de pagar</strong></li>\n        <li>Debe ser <strong>objetivo y verificable</strong></li>\n      </ul>\n\n      <p><strong>Ejemplos por tributos:</strong></p>\n      <table>\n        <tr><th>Tributo</th><th>Hecho Imponible</th></tr>\n        <tr><td>IRPF</td><td>Obtención de renta por el contribuyente</td></tr>\n        <tr><td>IVA</td><td>Entregas de bienes y prestaciones de servicios</td></tr>\n        <tr><td>Impuesto de Sociedades</td><td>Obtención de renta por las sociedades</td></tr>\n        <tr><td>IBI</td><td>Propiedad de bienes inmuebles</td></tr>\n        <tr><td>Impuesto de Sucesiones</td><td>Adquisición de bienes por herencia</td></tr>\n      </table>\n\n      <p><strong>Elementos del hecho imponible:</strong></p>\n      <ul>\n        <li><strong>Sujeto pasivo:</strong> Persona obligada al pago</li>\n        <li><strong>Base imponible:</strong> Valoración cuantitativa del hecho imponible</li>\n        <li><strong>Tipo de gravamen:</strong> Porcentaje o cuota a aplicar</li>\n        <li><strong>Devengo:</strong> Momento en que se produce el hecho imponible</li>\n      </ul>\n\n      <p><strong>Principio de reserva de ley:</strong> Solo la ley puede establecer los hechos imponibles (Art. 133.1 de la Constitución Española)</p>\n\n      <p><strong>Base legal:</strong> Ley 58/2003, de 17 de diciembre, General Tributaria (Art. 20)</p>\n    `,\n        estudiado: false\n    },\n    {\n        id: 10,\n        tema: \"conceptos\",\n        titulo: \"Derechos Pol\\xedticos de Ciudadanos Europeos\",\n        contenido: \"Derechos de participaci\\xf3n pol\\xedtica de los ciudadanos de la UE en Espa\\xf1a.\",\n        detalles: `\n      <p><strong>Definición:</strong> Derechos de los ciudadanos de la Unión Europea residentes en España para participar en elecciones municipales y europeas.</p>\n\n      <p><strong>Base Legal:</strong></p>\n      <ul>\n        <li><strong>Tratado de Funcionamiento de la UE</strong> (Art. 22)</li>\n        <li><strong>Constitución Española</strong> (Art. 13.2)</li>\n        <li><strong>Ley Orgánica 5/1985</strong> del Régimen Electoral General</li>\n        <li><strong>Real Decreto 207/1996</strong> sobre derechos de participación</li>\n      </ul>\n\n      <p><strong>Derechos de Sufragio Activo (Votar):</strong></p>\n      <table>\n        <tr><th>Tipo de Elección</th><th>Derecho</th><th>Requisitos</th></tr>\n        <tr><td><strong>Elecciones Municipales</strong></td><td>SÍ pueden votar</td><td>\n          <ul>\n            <li>Ser ciudadano de la UE</li>\n            <li>Residir legalmente en España</li>\n            <li>Estar inscrito en el censo electoral</li>\n            <li>No estar privado del derecho en su país de origen</li>\n          </ul>\n        </td></tr>\n        <tr><td><strong>Elecciones Autonómicas</strong></td><td>NO pueden votar*</td><td>*Excepto si hay reciprocidad (caso específico)</td></tr>\n        <tr><td><strong>Elecciones Generales</strong></td><td>NO pueden votar</td><td>Reservado a ciudadanos españoles</td></tr>\n        <tr><td><strong>Elecciones Europeas</strong></td><td>SÍ pueden votar</td><td>En España o en su país de origen (deben elegir)</td></tr>\n        <tr><td><strong>Referéndums</strong></td><td>Depende del tipo</td><td>Solo en consultas municipales</td></tr>\n      </table>\n\n      <p><strong>Derechos de Sufragio Pasivo (Ser Candidato):</strong></p>\n      <table>\n        <tr><th>Cargo</th><th>Puede ser Candidato</th><th>Condiciones Especiales</th></tr>\n        <tr><td><strong>Concejal</strong></td><td>SÍ</td><td>Mismos requisitos que para votar</td></tr>\n        <tr><td><strong>Alcalde</strong></td><td>SÍ</td><td>Debe ser elegido concejal primero</td></tr>\n        <tr><td><strong>Diputado Autonómico</strong></td><td>NO*</td><td>*Excepto con tratados de reciprocidad</td></tr>\n        <tr><td><strong>Diputado/Senador</strong></td><td>NO</td><td>Reservado a ciudadanos españoles</td></tr>\n        <tr><td><strong>Eurodiputado</strong></td><td>SÍ</td><td>Pueden presentarse en cualquier país de la UE</td></tr>\n      </table>\n\n      <p><strong>Requisitos específicos para ser Alcalde:</strong></p>\n      <ul>\n        <li>Ser ciudadano de la UE con residencia legal en España</li>\n        <li>Estar inscrito en el censo electoral del municipio</li>\n        <li>Ser elegido <strong>concejal</strong> en las elecciones municipales</li>\n        <li>Ser <strong>elegido por el Pleno</strong> municipal como Alcalde</li>\n        <li>No estar incurso en causas de inelegibilidad</li>\n        <li>No estar privado del derecho en su país de origen</li>\n      </ul>\n\n      <p><strong>Procedimiento para ejercer estos derechos:</strong></p>\n      <ol>\n        <li><strong>Inscripción en el censo:</strong> Solicitar la inclusión en el Censo de Extranjeros Residentes en España (CERE)</li>\n        <li><strong>Plazo:</strong> Hasta 30 días naturales antes de las elecciones</li>\n        <li><strong>Documentación:</strong> Pasaporte o DNI del país de origen y certificado de residencia</li>\n        <li><strong>Declaración:</strong> Firmar declaración de no privación de derechos en país de origen</li>\n      </ol>\n\n      <p><strong>Casos especiales:</strong></p>\n      <ul>\n        <li><strong>Reino Unido:</strong> Tras el Brexit, los ciudadanos británicos perdieron estos derechos</li>\n        <strong>Países nórdicos:</strong> Algunos tienen acuerdos de reciprocidad para elecciones autonómicas</li>\n        <li><strong>Funcionarios europeos:</strong> Tienen derechos especiales en algunos casos</li>\n      </ul>\n\n      <p><strong>Limitaciones importantes:</strong></p>\n      <ul>\n        <li>NO pueden votar en <strong>elecciones generales</strong> (Congreso/Senado)</li>\n        <li>NO pueden ser <strong>candidatos a cargos nacionales</strong></li>\n        <li>NO pueden votar en <strong>referéndums nacionales</strong></li>\n        <li>Deben <strong>elegir</strong> entre votar en España o en su país para elecciones europeas</li>\n      </ul>\n\n      <p><strong>Ejemplos prácticos:</strong></p>\n      <ul>\n        <li>Un <strong>francés</strong> residente en Madrid: Puede votar y ser alcalde</li>\n        <li>Un <strong>alemán</strong> en Barcelona: Puede ser concejal pero no diputado autonómico</li>\n        <li>Un <strong>italiano</strong> en Sevilla: Puede votar en municipales pero no en generales</li>\n      </ul>\n\n      <p><strong>Base constitucional:</strong> Artículo 13.2 CE: \"Solamente los españoles serán titulares de los derechos reconocidos en el artículo 23, salvo lo que, atendiendo a criterios de reciprocidad, pueda establecerse por tratado o ley para el derecho de sufragio activo y pasivo en las elecciones municipales.\"</p>\n    `,\n        estudiado: false\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/conceptos.js\n");

